import { FunctionComponent, useState } from "react";
import Card from "../interfaces/Card";

interface FavCardsProps {
  favCards: Card[];
  setFavCards: Function;
}

const FavCards: FunctionComponent<FavCardsProps> = ({ favCards, setFavCards }) => {
  return (
    <>
      <div>
        <h2>Favorite Page</h2>
        {favCards.map((card) => (
          <div key={card.id}>
            <h3>{card.title}</h3>
            {/* Render the rest of the card's content */}
          </div>
        ))}
      </div>
    </>
  );
};

export default FavCards;
